package net.dotefekts.bungee.dotutils;

public class SkinTextures {
	public static SkinTexture WHITE = new SkinTexture(
		"",
		""
	);
	
	public static SkinTexture BLACK = new SkinTexture(
		"",
		""
	);
	
	public static SkinTexture TAB_BLANK = new SkinTexture(
		"",
		""
	);
	
	public static class SkinTexture {
		public final String Texture;
		public final String Signature;
		
		public SkinTexture(String texture, String signature) {
			Texture = texture;
			Signature = signature;
		}
	}
}
